import React from 'react';
import {Ul, Img, Atag, H1, Li} from '../components/index';
const Header = (props) => {
  return (
    <React.Fragment>
        <H1 className={'hover:opacity-60'} text={<Atag link={'#'} text={<Img className={''} src={'./logo.svg'}/>}/>}/>
      <nav className={''}>
        <Ul className={'flex justify-between items-center p-3'}>
        <Li className={'ml-5 text-base'}>
          <Atag className={'hover:opacity-60'} link={'#about'} text={'About'}/>
        </Li>
        <Li className={'ml-5'}>
          <Atag className={'hover:opacity-60'} link={'#works'} text={'Works'}/>
        </Li>
        <Li className={'ml-5'}>
        <Atag className={'hover:opacity-60'} link={'#news'} text={'News'}/>
        </Li>
        <Li className={'ml-5'} text={<Atag className={'hover:opacity-60'} link={'#contact'} text={'Contact'}/>} />
        <Li className={'ml-5'} text={<Atag link={'#contact'} text={<Img className={'h-5 w-5 hover:opacity-60'} src={'./icon-instagram.png'}/>}/>} />
        </Ul>
      </nav>
    </React.Fragment>
  );
}

export default Header;
